fn curve_order() -> BigUint {
    return BigUint::parse_bytes("21888242871839275222246405745257275088548364400416034343698204186575808495617".as_bytes(), 10).unwrap();
    // return U256::from_dec_str("21888242871839275222246405745257275088548364400416034343698204186575808495617").unwrap();
}

fn final_exponentiate(f: &FQP) -> FQP {
    let p1 = BigUint::parse_bytes(Fq::FIELD_MODULUS().to_string().as_bytes(), 10).unwrap().pow(12).checked_sub(&BigUint::one()).unwrap();
    let p = p1.div(curve_order());
    let res = f.pow_biguint(&p);
    println!("final_exponentiate:: f: {:?}, p: {}, res: {:?}", f, p, res);
    res
}

fn pairing_p(p: &G1Point, q: &G2Point) -> FQP {
    assert!(is_on_curve_g1(p, &b()));
    // assert!(is_on_curve_g2(q, &b2()));
    let q2 = twist(*q);
    let p2 = cast_point_to_fq12(*p);
    let res = miller_loop(q2, p2);
    res
}

/// @return the result of computing the pairing check
/// e(p1[0], p2[0]) *  .... * e(p1[n], p2[n]) == 1
/// For example pairing([P1(), P1().negate()], [P2(), P2()]) should
/// return true.
fn pairing(p1: &[G1Point], p2: &[G2Point]) -> bool {
    println!("pairing:\np1:{:?}\np2:{:?}", p1, p2);
    assert!(p1.len() == p2.len());
    let mut product = FQP::fq12_one();
    for i in 0..p1.len() {
        println!("pairing i={}", i);
        println!("pairing p1_i={}", p1[i]);
        println!("pairing p2_i_x0 p2_i_x1: {},{}", p2[i].x[0], p2[i].x[1]);
        println!("pairing p2_i_y0 p2_i_y1: {},{}", p2[i].y[0], p2[i].y[1]);
        let p = pairing_p(&p1[i], &p2[i]);
        println!("pairing res_i={:?}", p);
        product = product.mul_fqp(&p);
        println!("pairing product: {:?}", product);
    }
    return product.coeffs[0] == Fq::one();
}

/// Convenience method for a pairing check for four pairs.
fn pairingProd4(
    a1: G1Point,
    a2: G2Point,
    b1: G1Point,
    b2: G2Point,
    c1: G1Point,
    c2: G2Point,
    d1: G1Point,
    d2: G2Point,
) -> bool {
    pairing(&[a1, b1, c1, d1], &[a2, b2, c2, d2])
}

