pub struct Verifier {}

impl Verifier {
    /// @return r  bool true if proof is valid
    fn verifyProof(a: [Fq; 2], b: [[Fq; 2]; 2], c: [Fq; 2], input: &[U256]) -> bool {
        let proof = Proof {
            A: G1Point { x: a[0], y: a[1] },
            B: G2Point {
                x: [b[0][0], b[0][1]],
                y: [b[1][0], b[1][1]],
            },
            C: G1Point { x: c[0], y: c[1] },
        };
        verify(input, &proof)
    }
}

