#[derive(Debug, Clone, Eq, PartialEq)]
struct FQP {
    coeffs: Vec<Fq>,
    modulus_coeffs: Vec<Fq>,
    degree: usize,
}

impl FQP {
    fn new(coeffs: Vec<Fq>, modulus_coeffs: Vec<Fq>) -> Self {
        assert_eq!(coeffs.len(), modulus_coeffs.len());
        Self {
            coeffs: coeffs,
            modulus_coeffs: modulus_coeffs.clone(),
            degree: modulus_coeffs.len(),
        }
    }

    fn fq2(coeffs: &[i32]) -> Self {
        assert_eq!(2, coeffs.len());
        Self {
            coeffs: coeffs.iter().map(|c| Fq::new(U256::from(*c))).collect(),
            modulus_coeffs: vec![Fq::one(), Fq::zero()],
            degree: 2,
        }
    }

    fn fq2_one() -> Self {
        FQP::fq2(&vec![1, 0])
    }

    fn fq12(coeffs: &[i32]) -> Self {
        assert_eq!(12, coeffs.len());
        Self {
            coeffs: coeffs.iter().map(|c| Fq::new(U256::from(*c))).collect(),
            modulus_coeffs: fq12_modulus_coeffs(),
            degree: 12,
        }
    }

    fn fq12_one() -> Self {
        let mut v = vec![Fq::one()];
        v.resize(12, Fq::zero());
        FQP::fq12_fq(&v)
    }

    fn fq12_fq(coeffs: &[Fq]) -> Self {
        Self {
            coeffs: coeffs.to_vec(),
            modulus_coeffs: fq12_modulus_coeffs(),
            degree: 12,
        }
    }

    fn fq2_g2(p2: [Fq; 2]) -> Self {
        Self {
            coeffs: p2.to_vec(),
            modulus_coeffs: vec![Fq::one(), Fq::zero()],
            degree: 2,
        }
    }

    fn add(&self, x: &FQP) -> FQP {
        let c = self.coeffs.iter().zip(x.coeffs.iter()).map(|(f1, f2)| f1.add(*f2)).collect();
        FQP {
            coeffs: c,
            modulus_coeffs: self.modulus_coeffs.clone(),
            degree: self.degree,
        }
    }

    fn sub(&self, x: &FQP) -> FQP {
        let c = self.coeffs.iter().zip(x.coeffs.iter()).map(|(f1, f2)| f1.sub(*f2)).collect();
        FQP {
            coeffs: c,
            modulus_coeffs: self.modulus_coeffs.clone(),
            degree: self.degree,
        }
    }

    fn div_fq(&self, x: Fq) -> FQP {
        let ncoeffs: Vec<Fq> = self.coeffs.iter().map(|c| c.div(x)).collect();
        // println!("div_fq!!, self: {:?}, x: {}, ncoeffs: {:?}",self,x,ncoeffs);
        FQP {
            coeffs: ncoeffs,
            modulus_coeffs: self.modulus_coeffs.clone(),
            degree: self.degree,
        }
    }

    fn div_fqp(&self, x: FQP) -> FQP {
        assert_eq!(self.degree, x.degree);
        let v = x.inv();
        let res = self.mul_fqp(&v);
        // println!("div_fqp!!: a:{:?}, b:{:?}, binv:{:?}, abinv: {:?}", self, x, v, res);
        // ff: a:[3, 0], b:[9, 1], binv:[21087453498479301738505683583845423561061080261299122796980902361914303298513, 14681138511599513868579906292550611339979233093309515871315818100066920017952], abinv:[19485874751759354771024239261021720505790618469301721065564631296452457478373, 266929791119991161246907387137283842545076965332900288569378510910307636690]
        res
    }

    fn inv(&self) -> FQP {
        fn deg(p: &Vec<Fq>) -> usize {
            let mut d = p.len() - 1;
            while p[d].0.is_zero() && d > 0 {
                d -= 1;
            }
            d
        }

        fn poly_rounded_div(a: &Vec<Fq>, b: &Vec<Fq>) -> Vec<Fq> {
            let dega = deg(&a);
            let degb = deg(&b);
            let mut temp = a.clone();
            let mut o = vec![Fq::zero(); a.len()];
            let dd = (dega as i32) - (degb as i32) + 1;
            assert!(dd >= 0);
            for i in (0..dd).rev() {
                let i = i as usize;
                o[i] = o[i].add(temp[degb + i].div(b[degb]));
                for c in 0..(degb + 1) {
                    temp[c + 1] = temp[c + 1].sub(o[c]);
                }
            }
            assert!(deg(&o) + 1 <= o.len());
            o.resize(deg(&o) + 1, Default::default());
            o
        }

        let mut lm = vec![Fq::one()];
        lm.resize(self.degree + 1, Fq::zero());
        let mut hm = vec![Fq::zero()];
        hm.resize(self.degree + 1, Fq::zero());
        let mut low = self.coeffs.clone();
        low.push(Fq::zero());
        let mut high = self.modulus_coeffs.clone();
        high.push(Fq::one());
        while deg(&low) > 0 {
            let mut r = poly_rounded_div(&high, &low);
            assert!(self.degree + 1 - r.len() >= 0);
            r.resize(self.degree + 1, Fq::zero());

            let mut nm = hm.clone();
            let mut new = high.clone();
            assert_eq!(lm.len(), hm.len());
            assert_eq!(lm.len(), low.len());
            assert_eq!(lm.len(), high.len());
            assert_eq!(lm.len(), nm.len());
            assert_eq!(lm.len(), new.len());
            assert_eq!(lm.len(), self.degree + 1);
            for i in 0..self.degree + 1 {
                for j in 0..(self.degree + 1 - i) {
                    nm[i + j] = nm[i + j].sub(lm[i].mul(r[j]));
                    new[i + j] = new[i + j].sub(low[i].mul(r[j]));
                }
            }
            // println!("inv!! lm: {:?}, low: {:?}, hm: {:?}, high: {:?}, nm: {:?}, new: {:?}", lm, low, hm, high, nm, new);
            hm = lm;
            lm = nm;
            high = low;
            low = new;
        }
        // println!("inv!! self: {:?} low[0]: {:?}", self, low[0]);
        lm.truncate(self.degree);
        let lmm = FQP {
            coeffs: lm,
            modulus_coeffs: self.modulus_coeffs.clone(),
            degree: self.degree,
        };
        // return self.__class__(lm[:self.degree]) / low[0]
        lmm.div_fq(low[0])
    }

    fn mul_fq(&self, x: Fq) -> FQP {
        FQP {
            coeffs: self.coeffs.iter().map(|c| c.mul(x)).collect(),
            modulus_coeffs: self.modulus_coeffs.clone(),
            degree: self.degree,
        }
    }

    fn mul_fqp(&self, x: &FQP) -> FQP {
        // println!("mul_fqp!! self:{:?}, x:{:?}",self,x);
        assert_eq!(self.degree, x.degree);
        let mut b = vec![Fq::zero(); self.degree * 2 - 1];
        for i in 0..self.degree {
            for j in 0..self.degree {
                let ind = i + j;
                let v = self.coeffs[i].mul(x.coeffs[j]);
                // println!("mul_fqp!! ind:{}, v: {}, b[ind]: {}, self.coeffs[i]: {}, x.coeffs[j]: {}",ind,v,b[ind], self.coeffs[i],x.coeffs[j]);
                b[ind] = b[ind].add(v);
                // b[i + j] = b[i + j].add(self.coeffs[i].mul(x.coeffs[j]));
            }
        }
        // println!("mul_fqp!! b:{:?}",b);
        while b.len() > self.degree {
            let exp = b.len() - self.degree - 1;
            let top = b.pop().unwrap();
            for i in 0..self.degree {
                b[exp + i] = b[exp + i].sub(top.mul(self.modulus_coeffs[i]));
            }
        }
        // println!("mul_fqp!! b2:{:?}",b);
        let res = FQP { coeffs: b, modulus_coeffs: self.modulus_coeffs.clone(), degree: self.degree };
        res
    }

    fn one(&self) -> Self {
        let mut v = vec![Fq::one()];
        v.resize(self.degree, Fq::zero());
        Self {
            coeffs: v,
            modulus_coeffs: self.modulus_coeffs.clone(),
            degree: self.degree,
        }
    }

    fn pow_biguint(&self, p: &BigUint) -> FQP {
        if p.is_zero() {
            let mut v = vec![Fq::one()];
            v.resize(self.degree, Fq::zero());
            FQP { coeffs: v, modulus_coeffs: self.modulus_coeffs.clone(), degree: self.degree }
        } else if p.is_one() {
            FQP { coeffs: self.coeffs.clone(), modulus_coeffs: self.modulus_coeffs.clone(), degree: self.degree }
        } else if p.is_even() {
            let p2: BigUint = p >> 1;
            self.mul_fqp(&self).pow_biguint(&p2)
        } else {
            let p2: BigUint = p >> 1;
            self.mul_fqp(&self).pow_biguint(&p2).mul_fqp(&self)
        }
    }

    fn pow(&self, p: U256) -> FQP {
        if p.is_zero() {
            // println!("pow!!0 {:?}^{}",self,p);
            let mut v = vec![Fq::one()];
            v.resize(self.degree, Fq::zero());
            FQP { coeffs: v, modulus_coeffs: self.modulus_coeffs.clone(), degree: self.degree }
        } else if p == U256::one() {
            // println!("pow!!1 {:?}^{}",self,p);
            FQP { coeffs: self.coeffs.clone(), modulus_coeffs: self.modulus_coeffs.clone(), degree: self.degree }
        } else if !p.bit(0) {
            // println!("pow!!2 {:?}^{}",self,p);
            self.mul_fqp(self).pow(p >> 1)
        } else {
            // println!("pow!!3 {:?}^{}",self,p);
            self.mul_fqp(self).pow(p >> 1).mul_fqp(self)
        }
    }

    fn neg(&self) -> FQP {
        let mut v = vec![Fq::zero(); self.degree];
        for i in 0..self.degree {
            v[i] = self.coeffs[i].neg();
        }
        FQP { coeffs: v, modulus_coeffs: self.modulus_coeffs.clone(), degree: self.degree }
    }
}

